import './App.css';
import Dictionary from "./Dictionary";
import Footer from "./Footer";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        {/* <div className="card"> */}
        <header className="App-header">
          <h1> Online Dictionary</h1>
        </header>
        <main>
          <Dictionary defaultKeyword="dictionary"/>
        </main>
          <Footer />
        {/* </div> */}
      </div>
    </div>
  );
}
